import { Routes, BrowserRouter as Router, Route, Link, HashRouter } from "react-router-dom";
import './App.scss';
import Nav from './components/nav';
import Home from './pages/HomeTronosPage';
import Personajes from './pages/PersonajesPages'
import Casas from './pages/CasasPages'
import Cronologia from './pages/CronologiaPage'
import CasasDetail from "./pages/CasaDetailPage";
import PersonajeDetail from "./pages/PersonajeDatailPage";
function App() {
  return (
    <div className="h-100">
   <Router>
     <Routes>
     <Route path="/" element={<Home/>}/>
     <Route path="/Personajes" element={<Personajes/>}/>
     <Route path="/Casas" element={<Casas/>}/>
     <Route path="/Cronologia" element={<Cronologia/>}/>
     <Route path="/CasasDetail/:id" element={<CasasDetail/>}/>
     <Route path="/PersonajeDetail/:id" element={<PersonajeDetail/>}/>

     </Routes>
     <Nav/>

   </Router>
   </div>
  );
}

export default App;
